    false,nt"url": null,nt"notes": "This annual narrative report for Arrowwood
    Wetland Management District outlines Refuge accomplishments during the 1988 calendar
    year. The report begins by giving a brief introduction to the Refuge, as well as
    the climatic and habitat conditions, the land acquisition program, planning, and
    administration during the year. Habitat management is discussed; topics include
    wetlands, croplands, grasslands, grazing, haying, fire management, pest control,
    and WPA easement monitoring. Wildlife- including endangered and threatened species,
    migratory birds and mammals- is also covered. The interpretation and recreation
    section discusses information and interpretation, recreation, and enforcement. Photographs
    and brief narrative reports on Chase Lake National Wildlife Refuge, Johnson Lake
    National Wildlife Refuge, and Halfway Lake National Wildlife Refuge are included.",nt"license_title":
